import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 20, height: 20, viewBox: "0 0 20 20", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M11.35 15.85a.5.5 0 01-.7 0L5.16 10.4a.55.55 0 010-.78l5.49-5.47a.5.5 0 01.7.71L6.2 10l5.16 5.15c.2.2.2.5 0 .7zm4 0a.5.5 0 01-.7 0L9.16 10.4a.55.55 0 010-.78l5.49-5.47a.5.5 0 11.7.71L10.2 10l5.16 5.15c.2.2.2.5 0 .7z", fill: primaryFill }));
};
const ChevronDoubleLeft20Regular = wrapIcon(rawSvg({}), 'ChevronDoubleLeft20Regular');
export default ChevronDoubleLeft20Regular;
